jobs_results.description:
We are looking for a dynamic and code lover, iOS Developer to join our team and help us in our Platforms!

If you want to be part of a young, fun and multicultural team and work for a growing company with multiple challenges and projects, please send us your application on our website (https://www.mobilu.eu/careers/).

You must have:
• At least 2 years of experience in a similar position and working environment;
• BSc or MSc in Computer Science or Computer Engineering;
• Development in a broad set of languages and frameworks on iOS;
• Knowledge of one or more of Swift, ObjectiveC, Java and Kotlin;
• Knowledge of common iOS frameworks and libraries;
• Knowledge of database systems like SQLite, but also of Realm or core data on iOS;
• Excellent problem-solving skills;
• Fluency in the English language

Extra points if you have:
• Knowledge of software testing solutions for iOS and Android;
• Knowledge of code versioning tools such as GIT;
• Knowledge of collaboration tools such as JIRA, Confluence, Trello, Teams;
• Conditional love for Star Wars

What Mobilu offers to you:
• Competitive salary based on your experience & Knowledge;
• Meals Card
• Health Insurance
• Partial remote working
• Multiple team building activities

This position is also available for Freelancers.

Requirements:
• BSc or MSc in Computer Science or Computer Engineering;
• Development in a broad set of languages and frameworks on iOS and Android;
• Knowledge of one or more of Swift, ObjectiveC, Java and Kotlin;
• Knowledge of common iOS and/or android frameworks and libraries;
• Knowledge of database systems like SQLite, but also of Realm or core data on iOS;
• Excellent problem solving skills;
• Good knowledge of English, both spoken and written.

Nice to have:
Knowledge of software testing solutions for iOS and Android;
Knowledge of GIT as a code versioning tool;
Knowledge of collaboration tools such as JIRA, Confluence, Trello.
